import React from "react";
import ReactDOM from "react-dom";
import {
  createBrowserRouter,
  RouterProvider,
  Routes,
  Route,
} from "react-router-dom";
import App from "./App"; // Replace with the actual App component from your App.js
import ReviewPage from "./ReviewPage"; // Replace with the actual ReviewPage component
import Contact from "./Contact"; // Replace with the actual Contact component
import SingleReviewPage from "./SingleReviewPage"; // Replace with the actual SingleReviewPage component
import MenuPage from "./MenuPage"; // Replace with the actual MenuPage component
import LocationPage from "./LocationPage"; // Replace with the actual LocationPage component
import { fetchReviews } from "./api"; // Replace with the actual API functions

const router = createBrowserRouter([
  {
    path: "/",
    element: <App />, // Replace with the actual App component
    children: [
      {
        path: "/reviews",
        element: <ReviewPage />, // Replace with the actual ReviewPage component
        loader() {
          return fetchReviews();
        },
      },
      {
        path: "/contact",
        element: <Contact />, // Replace with the actual Contact component
      },
      {
        path: "/menu",
        element: <MenuPage />, // Replace with the actual MenuPage component
      },
      {
        path: "/location",
        element: <LocationPage />, // Replace with the actual LocationPage component
      },
    ],
  },
]);

ReactDOM.createRoot(document.getElementById("root")).render(
  <Routes>{router}</Routes>,
);
